			"name":"Conductivity Circuit",
			"description":"There was a time when manufacturing custom scientific equipment for a project was only available to the elite; a time when environmental data was only available to governments and subject to the political pressures of the day.Atlas Scientific is working hard to end those days.We are the new scientists, all of us.Reading the Electrical Conductivity(E.C.), total dissolved solids and salinity of water, was notoriously hard to do .With little information available on the subject, many engineers had to abandon their goal of adding a conductivity circuit to their design.Atlas Scientific has finally put an end to this problem.The Atlas Scientific Conductivity Circuit is small, modularized, and designed specifically to read the conductivity, total dissolved solids and salinity of water.The Atlas Scientific Conductivity Circuit is designed for both continuous and intermittent readings.After calibration, the Conductivity Sensor can be immersed in a liquid and operate continuously for 12 months before recalibration is recommended. \ u2022 Conductivity readings + \/-5 \ u03bcs \ u2022 Full Conductivity capability from 11 \ u03bcs to 92, 000 \ u03bcs \ u2022 Temperature dependent or temperature independent readings \ u2022 Total dissolved solids(TDS)referenced to KCL \ u2022 Salinity is derived from the Practical Salinity Scale(PSS-78) \ u2022 Data output is a comma separated string:  \ u03bcs, TDS, Salinity \ u2022 Single reading or continuous reading modes \ u2022 Simple asynchronous serial connectivity(voltage swing 0-5v) \ u2022 Simple instruction set consisting of only 6(not including calibration)commands \ u2022 Micro footprint circuitry \ u2022 Debugging LED ' s \ u2022 5V operational voltage \ u2022 Dimensions : 18.4mm X 20.56mm(0.72'X0.80')",
