			"name":"EasyDriver_v44",
			"description":"\tReplacement: ROB-10267. The new version fixes the silkscreen error. This page is for reference only.\tThe EasyDriver is a simple to use stepper motor driver, compatible with anything that can output a digital 0 to 5V pulse. EasyDriver requires a 7V to 30V supply to power the motor, and has an on board voltage regulator for the digital interface. Connect a 4-wire stepper motor and a microcontroller and you' ve got precision motor control!EasyDriver drives bi-polar motors, and motors wired as bi-polar.I.e.4, 6, or 8 wire stepper motors. This is the newest version of EasyDriver V4 co-designed with Brian Schmalz.It provides much more flexibility and control over your stepper motor, when compared to older versions.The microstep select(MS1 and MS2)pins of the A3967 are broken out allowing adjustments to the microstepping resolution.The sleep and enable pins are also broken out for further control.  Caution: Do not connect or disconnect a motor while the driver is energized.This will cause permanent damage to the A3967 IC. Note: Version 4.3 of the PCB has an error on the Current Adjustment silkscreen.The Min\/Max labels are reversed.The correct direction for maximum current is counter-clockwise.  Features:    A3967 microstepping driver   MS1 and MS2 pins broken out to change microstepping resolution to full, half, quarter and eigth steps   Compatible with 4, 6, and 8 wire stepper motors   Adjustable current control from 150mA\/phase to 750mA\/phase   Power supply range from 7V to 30V.The higher the voltage, the higher the torque. Documents:    Schematic   A3967 Datasheet   EasyDriver Website   Example Stepper Motor Control   Example Arduino Tutorial in Portuguese ",
