			"description":"The Si4735 is the first digital CMOS AM\/FM radio receiver IC that integrates the complete tuner function from antenna input to audio output. This feature-rich solution includes advanced seek algorithms, soft mute, auto-calibrated digital tuning, and FM stereo processing. The chip also incorporates a digital processor for the European Radio Data System (RDS) and the North American Radio Broadcast Data System (RBDS), including all required symbol decoding, block synchronization, error detection, and error correction functions. Basically it' s an entire AM\/FM, LW\/SW radio in a single chip. Now that we 've mounted it on a shield, you can harness all of that sweet radio-playing power right from your Arduino. Simply stack the shield onto your Arduino board, plug in some speakers (headphones don' t seem to work as well without a preamp)and use the library below to control the volume, channel selection, etc.The library also allows you to send a variety of other commands constructed by consulting the Si4735 Programmers Guide. This board seems to get decent reception compared to other stereos around the office even using a simple wire antenna.If you happen to have an antenna that you 'd like to use it can be soldered right to the via marked 'antenna'.\tDocuments: \t\t\tSchematic \t\t\tEagle Files\t\t\tDatasheet\t\t\tArduino Library\t\t\tProgramming Guide\t\t\tRBDS Standard",
