			"name":"Arduino Cellular Shield",
			"description":"The Cellular Shield for Arduino includes all the parts needed to interface your Arduino with an SM5100B cellular module. This allows you to easily add SMS, GSM\/GPRS, and TCP\/IP functionalities to your Arduino-based project. All you need to add cellular functionality to your Arduino project is a SIM card (pre-paid or straight from your phone) and an antenna and you can start sending Serial.print statements to make calls, send texts and serve web pages!\t The main components of the Cellular Shield are a 60-pin SM5100B connector, a SIM card socket, and an SPX29302 voltage regulator configured to regulate the Arduino' s raw voltage to 3.8V.The board 's red LED indicates power. The Arduino' s reset button is also brought out on the shield.  Two solder jumpers on the board allow you to select which serial pins interface with the cellular module-software(D2, D3)or hardware(D0, D1).There is also a 5-pin, 0.1' spaced header with connections for microphone inputs and speaker outputs.Headers are not soldered on, we recommend the 6 and 8-pin stackable headers.  The SM5100B cellular module is included with this product, however an antenna is not.It is pre-configured to 9600bps.  Documents:    Schematic   Sample Sketch   SM5100B Datasheet   SM5100B AT Command Set   SM5100B SMS App Note   SM5100B TCP\/IP App Note   Arduino Tutorial",
			"image":"core\/breadboard\/cellular shield-v12_breadboard.svg",
