			"name":"ENV-32X Flash Memory Data Logger",
			"description":"As computer power increases with each passing year, so too, does computer memory. Now, 32 gigabytes of flash memory so cheap, it' s disposable.However, for the embedded systems engineer 32 gigabytes of flash memory is simply useless over kill.An 8 bit computer system is simply not designed to efficiently manage 32, 000, 000, 000 bytes of memory.Atlas Scientific has designed a memory system specifically designed to hold small strings of data no larger than 128 bytes long, a perfect size for holding sensor data.The ENV-32X Embedded Data Logger has been designed, like all other Atlas Scientific products, to be easy to use and easy to implement.The ENV-32X Embedded Data Logger requires no additional hardware and no drivers to operate.Simply output the string to be stored and the ENV-32X Embedded Data Logger takes care of the rest. \ u2022 32Mb flash memory \ u2022 No drivers required \ u2022 Specifically designed to hold strings of up to 128 characters long \ u2022 Read\/Write\/Erase 32, 760 individual strings \ u2022 Fast operation read\/write a 128 byte string in just 3ms \ u2022 Write to memory confirmation \ u2022 Two different organized read back methods \ u2022 20 year data retention \ u2022 Up to 3, 276, 000, 000 program\/erase cycles \ u2022 Simple asynchronous serial connectivity(voltage swing 0-VCC) \ u2022 Simple instruction set consisting of only 7 commands \ u2022 Debugging LED 's\u2022 3.3 volt operation\u2022 Low power consumption\u2022 Well suited for airborne applications weighing only 1.53 grams",
