			"name":"Arduino Musical Instrument Shield",
			"description":"Do you ever wish your Arduino was more musically talented ? Or maybe your project could use some cool sound effects.The Musical Instrument Shield is an easy way to add great sounding MIDI sound to your next Arduino project.This board is built around the VS1053 MP3 and MIDI codec IC, wired in MIDI mode.Simply connect a speaker\/stereo\/pair of headphones to the 1\/8' stereo jack on the shied and pass the proper serial commands to the IC and you ' ll be playing music in no time! The VS1053 contains two large tonebanks including various piano, woodwinds, brass, synth, SFX and percussion sounds.The shield is also capable of playing several tones simultaneously(maximum polyphony of up to 31 sounds!).Take a look at our example code to get an idea of how easy it is to add musical zest to your next Arduino gadget. In this version, we're using a better regulator,	corrected the speaker connectors, and have the reset pin pulled high.We've also included solder jumpers for pin 3 and 4 so they're selectable. Replaces: DEV-10529",
