			"name":"Power Cell LiPo Charger\/Booster",
			"description":"The PowerCell board is a single cell LiPo boost converter(to 3.3V and 5V)and micro-USB charger in one.The board comes with a JST connector for a single cell LiPo battery, a micro-USB connector for the 5V charge input, and selectable 3.3V and 5V output pins(labeled \ u2018out \ u2019).There are also two charge pins broken out(labeled \ u2018charge \ u2019), so you can use another 5V power source to charge the batteries, if you don \ u2019t have a micro-USB cable.We \ u2019ve also broken out the power-save and enable pins, so that you can have full control of the switching regulator.Keep in mind, if you keep your battery connected to the Powercell, it is recommended that you disable the switching regulator(pull EN low)in order to prevent the battery from discharging and reaching the under voltage cutoff on the battery itself.There is also an under-voltage lockout on the Powercell board which is tied to a solder jumper so that you can disable it if you like.The micro-USB charger uses the MCP73831 and allows you to charge 3.7V LiPo cells at a rate of 100mA max.If you want to charge at a faster rate, you will need to connect a separate power supply to the pins labeled \ u20185V \ u2019 and \ u2018GND \ u2019 under the label \ u2018charge \ u2019.The boost converter is based on the TPS61200 from TI and has solder jumper selectable 5V and 3.3V output, and an under voltage protection of 2.6V(which can be disabled via solder jumper on the back of the PCB).Note: This board does not have reverse polarity protection, so please be sure to recognize the polarity of your connections!Dimensions: 1.03 x 0.95' Features: -MCP73831 Single Cell LiPo charger at 500mA-TPS61200 Boost Converter-Selectable output voltage 3.3 or 5V-5V @ 600mA max-3.3V @ 200mA max-Undervoltage lock out at 2.6V(with disable jumper)-Quiescent current, less than 55uA-JST connector for LiPo battery-micro-USB connector for charge power source-Inductor: 4.7uH, 1.2A Sumida CDRH2D18-Over temperature protection",
