			"name":"IOIO for Android",
			"description":"The IOIO(pronounced 'yo-yo') is a board specially designed to work with your Android device(OS versions 1.5 and greater).The board provides robust connectivity to an Android device via a USB connection and is fully controllable from within an Android application using a simple and intuitive Java API-no embedded programming or external programmer will ever be needed! So far, the devices proven to work are: G1, Nexus One, Nexus S, Motorola Droid X.If you get the IOIO working on your Android device, please let us know in the comments below, thanks! The IOIO board contains a single MCU that acts as a USB host and interprets commands from an Android app.In addition, the IOIO can interact with peripheral devices in the same way as most MCUs.Digital Input\/Output, PWM, Analog Input, I2C, SPI, and UART control can all be used with the IOIO.Code to control these interfaces is written in the same way as you write an Android app with the help of a simple to use app-level library.In other words, you can combine the awesome computing power, Internet\/Bluetooth connectivity, touch screen, and a variety of sensors from your Android device with the ability to easily add peripheral devices to interact with the outside world.Also, using the IOIO does not require any hardware or software modifications to your Android device, thus preserving the warranty as well as making the functionality available to non-hackers. If you are new to the IOIO or developing apps with Android, please use these resources to help get started:    Beginner 's Guide\t\t\tExample Projects (see the ' Application ' directory in the latest download)\tFor firmware upgrades, you can download the IOIO Manager app (see the QR code in the images to the right). Also featured is a Programmer function, which lets you upgrade the bootloader of your IOIO using another IOIO as a programmer! See the IOIO Manager wiki for more information.\tUpdate: The IOIO now has beta firmware available which supports Google' s Open Accessory(ADK)protocol.The code base can be found here. Documents:    Schematic   Eagle Files   Firmware Downloads   IOIO Code Base   Beginner 's Guide\t\t\tIOIO Wiki Home\t\t\tIOIO Manager Wiki\t\t\tIOIO Manager Application\t\t\tIOIO Discussion\/Support Group\tReplaces: DEV-10585",
